function TodayWeatherCard(props) {
    const { date, city, weather, water, wind, sun, minTemp, maxTemp } = props;
    return (
        <>
            <p>{date.toString()}</p>
            <h2>{city}</h2>
            <h2>{weather}</h2>
            <h2>{water}</h2>
            <h2>{wind}</h2>
            <h2>{sun}</h2>
            <h2>{minTemp}</h2>
            <h2>{maxTemp}</h2>
        </>
    )
}

export default TodayWeatherCard;
